import Canvas from './modules/application/canvas/Canvas.js';
import Selection from './modules/application/selection/Selection.js';

export default class Student extends Component {
    render() {
        return (
          <div className="">
            <Header />
            <Table /> 
            <Canvas />
          </div>
        )
